import React from "react";

//Style
import style from '../styles/loginManager/loginManager.css';

//Images
import customerManagerText from '../images/1x/customerManagerText.png'
import customerManagerText2x from '../images/2x/customerManagerText@2x.png' 
import customerManagerText3x from '../images/3x/customerManagerText@3x.png'

function LoginManager() {
  return (

    <div className="login-manager-container">


      <div className="background-container">

        <img className="customer-manager-textImage-1" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>
        <img className="customer-manager-textImage-2" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>
        <img className="customer-manager-textImage-3" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>
        <img className="customer-manager-textImage-4" srcSet={`${customerManagerText} 1x, ${customerManagerText2x} 2x, ${customerManagerText3x} 3x`} src={customerManagerText} alt="customerManagerText"/>

        <h2 className="subtitle">customer Manager</h2>

      </div>

      <div className="circle"></div>

      <div className="login-container">

        <h2>mvm</h2>
        <p>customer manager</p>

        <div className="line"></div>

        <form>

          <p>user</p>

          <input type="text" />

        </form>

      </div>


    </div>
  );
}

export { LoginManager  };
